import React, { Component } from 'react';

class Room extends Component {

  constructor(props) {
    super(props);
    this.state = {
      roomId: this.props.match.params.id,
      clientPeerConn: null,
    };
  };

  componentDidMount() {
    // 
    let tempClientPeerConn = new RTCPeerConnection({'iceServers':[{'urls':'stun:stun.l.google.com:19302'}]});
    console.log(tempClientPeerConn);
    tempClientPeerConn.createOffer().then(offer => console.log(offer));
    tempClientPeerConn.createAnswer().then(answer => console.log(answer));
  };

  render() {
    return(
      <h2>Room { this.state.roomId }</h2>
    );
  };
};

export default Room;
